import React, {Component} from 'react'
import './todoitems.css'
const TodoItems = (props) => {
    const {items} = props;
    const {Delete} = props.delete;
    const ListItems = items.map((item) => {
        return (
            <div key={item.id}>
                <span>{item.id}</span>
                <span>{item.name}</span>
                <span>{item.age}</span>
                <button onClick={Delete}>&times;</button>
            </div>
        );
    })
    return(
        <div className='ListItems'>
            <div>
                <span>Name</span>
                <span>Age</span>
                <span>Action</span>
            </div>
            {ListItems}
        </div>
    );
}

export default TodoItems;
